def closest_integer(value):

    num = float(value)
    floor_num = int(num // 1)
    ceil_num = int(-(-num // 1))
    diff_floor = abs(num - floor_num)
    diff_ceil = abs(ceil_num - num)
    if diff_floor > diff_ceil:
        return floor_num
    elif diff_floor < diff_ceil:
        return ceil_num
    else:
        # Equidistant: round away from zero
        return ceil_num if num > 0 else floor_num

