function separate_paren_groups(paren_string) {   
    const stack = [];
    const groups = [];
    let i = 0;
    const n = paren_string.length;

    const s = paren_string.split(' ').join('');

    while (i < n) {
        if (s[i] === undefined) {
            throw new Error("IndexError: string index out of range");
        }
        if (s[i] === '(') {
            stack.push(i);
        } else if (s[i] === ')') {
            const start = stack.pop();
            if (stack.length === 0) {
                groups.push(s.substring(start, i + 1));
            }
        }
        i += 1;
    }

    return groups;
}

