def parse_nested_parens(paren_string: str) -> list[int]:

    stack = []
    max_depths = []

    for char in paren_string:
        if char == '(':
            stack.append(char)
            max_depths.append(len(stack))
        elif char == ')':
            if stack:
                stack.pop()

    return max(max_depths) if max_depths else 0

