function parse_nested_parens(paren_string) {

    const stack = [];
    const max_depths = [];

    for (const char of paren_string) {
        if (char === '(') {
            stack.push(char);
            max_depths.push(stack.length);
        } else if (char === ')') {
            if (stack.length > 0) {
                stack.pop();
            }
        }
    }

    return max_depths.length > 0 ? Math.max(...max_depths) : 0;
}

