def starts_one_ends(n):

    if n <= 0:
        return 0
    if n == 1:
        # 1-digit numbers: 1,2,3,...,9; only '1' starts or ends with 1
        return 1
    # For n >= 2, count = 2 * 10^(n-1) - 1
    # Explanation:
    # - Numbers starting with 1: 10^(n-1)
    # - Numbers ending with 1: 10^(n-1)
    # - Numbers starting and ending with 1: 10^(n-2)
    # Total = starting with 1 + ending with 1 - starting and ending with 1
    return 2 * 10 ** (n - 1) - 10 ** (n - 2)

