function is_bored(S) {   
    const sentences = S.split(/[.?!]/);
    let count = 0;
    for (const sentence of sentences) {
        const trimmed = sentence.trim();
        if (trimmed.startsWith('I')) {
            count += 1;
        }
    }
    return count;
}

