function circular_shift(x, shift) {   
    const s = String(x);
    const n = s.length;
    shift = shift % n; // Normalize shift
    if (shift === 0) {
        return s;
    } else if (shift > n) {
        return s.split('').reverse().join('');
    } else {
        return s.slice(-shift) + s.slice(0, -shift);
    }
}

