function is_floats(x) {
  // Single float-like number
  if (typeof x === "number" && Number.isFinite(x)) {
    return true;
  }

  // Array or tuple of numbers
  if (Array.isArray(x)) {
    return x.every(v => typeof v === "number" && Number.isFinite(v));
  }

  // Typed arrays similar to NumPy float arrays
  if (x instanceof Float32Array || x instanceof Float64Array) {
    return true;
  }

  return false;
}

function all_close(a, b, rtol = 1e-7, atol = 1e-8) {
  // Scalar comparison
  if (typeof a === "number" && typeof b === "number") {
    return Math.abs(a - b) <= atol + rtol * Math.abs(b);
  }

  // Normal arrays
  if (Array.isArray(a) && Array.isArray(b) && a.length === b.length) {
    return a.every((ai, i) => all_close(ai, b[i], rtol, atol));
  }

  // Typed arrays
  if (
    (a instanceof Float32Array || a instanceof Float64Array) &&
    (b instanceof Float32Array || b instanceof Float64Array) &&
    a.length === b.length
  ) {
    return [...a].every((ai, i) => all_close(ai, b[i], rtol, atol));
  }

  return false;
}

function assertion(out, exp, atol, inp) {
  const exact_match = JSON.stringify(out) === JSON.stringify(exp);

  // If atol is zero and expected is float-like, default to 1e-6
  if (atol === 0 && is_floats(exp)) {
    atol = 1e-6;
  }

  if (!exact_match && atol !== 0) {
    if (!all_close(out, exp, 1e-7, atol)) {
      throw new Error(
        `encode() failed on input: \`${JSON.stringify(inp[0])}\`, expected \`${JSON.stringify(exp)}\` but got \`${JSON.stringify(out)}\``
      );
    }
  } else {
    if (!exact_match) {
      throw new Error(
        `encode() failed on input: \`${JSON.stringify(inp[0])}\`, expected \`${JSON.stringify(exp)}\` but got \`${JSON.stringify(out)}\``
      );
    }
  }
}

