    for (const ch of message) {
        if (/[a-zA-Z]/.test(ch)) {
            let swapped = ch === ch.toUpperCase() ? ch.toLowerCase() : ch.toUpperCase();
            if ('aeiouAEIOU'.includes(swapped)) {
                swapped = shift_vowel(swapped);
            }
            result += swapped;
        } else {
            result += ch;
        }
    }
    return result;
}
